import React from "react";
import { Form, Input, Button, Row, Col, Card } from "antd";
import "antd/dist/antd.css";
const Index = (props) => {
  return (
    <div className="container">
        <div className="login">
        <Card>
        <Row>
          <Col flex={3}>s</Col>
          <Col flex={2}>s</Col>
        </Row>
      </Card>
        </div>
    </div>
  );
};
export default Index;
